const swiper1 = document.querySelector('.slider-container'), 
	  swiper2 = document.querySelector('.swiper-container'), 
	  menuBtn = document.querySelectorAll('.header__btn'),
	  menu = document.querySelector('.header__menu');
	  swiperPlay = document.querySelector('.first__slider-play');




let swiperSlider1 = new Swiper(swiper1, {
	centeredSlides: true,
	slidesPerView: 'auto',
	loop: true,
	spaceBetween: 105,
});




let swiperSlider2 = new Swiper(swiper2, {
	centeredSlides: true,
	slidesPerView: 1,
	loop: true,
	spaceBetween: 10,
	fadeEffect: {
		crossFade: true
	},
	effect: 'fade',
	navigation: {
		nextEl: '.btn-right',
		prevEl: '.btn-left',
	},
	autoplay: {
		delay: 4000,
	}

});

swiperPlay.addEventListener('click', (e) => {
	let video = e.currentTarget.closest('.main-slider__media').querySelector('video');
	video.play();
	e.currentTarget.style.display = 'none';
	setTimeout(() => {
		video.volume = 0.5;
	}, 1000)});
// Menu Burger 


if(menuBtn.length > 0){
	menuBtn.forEach(el => {
		
		el.addEventListener('click', (e) => {
			menu.classList.toggle('visible')
			el.classList.toggle('active')
		})
	})
}

// Form Validation

let tel = document.querySelectorAll('input[type="tel"]')
let im = new Inputmask('+1(999)-999-9999')
im.mask(tel)


let validateForms = function(selector, rules) {

	new window.JustValidate(selector, {
		rules: rules,
		submitHandler: function (form, values, ajax) {
			var formData = new FormData(form);

			var xhr = new XMLHttpRequest();


			xhr.onreadystatechange = function () {
				if (xhr.readyState === 4) {

					if (xhr.status === 200) {
						console.log('Отправлено!')
					} else {

					}
				}
			}

			// Add any event handlers here...
			xhr.open('POST', "mail.php", true);
            xhr.send(formData);

            form.reset();
		},
	});
}

// validateForms('.mailing__form', { email: { required: true, email: true } }, 'mailing-window', 'materialy s proshloj konferencii');
validateForms('.sign-up__form', { email: { required: true, email: true }, tel: { required: true } });
validateForms('.footer__form ', { email: { required: true, email: true } });